import React from 'react';
import { Task } from './Task';

interface ListProps {
    todos: Array<Todo>;
    toggleTodo: ToggleTodo;
}

export const List: React.FC<ListProps> = ({ todos, toggleTodo }) => {
return (
    <ul>
        {todos.map(todo => {
          return <Task key={todo.text} todo={todo} toggleTodo={toggleTodo}/>;
        })}
    </ul>
  );
};
